import React, { useState } from 'react';
import './App.css'; // Import the App.css file for styling

const Header = () => {
  const [isLoginClicked, setIsLoginClicked] = useState(false); // Track if the login dropdown is visible

  const toggleLoginOptions = () => {
    setIsLoginClicked(!isLoginClicked); // Toggle the dropdown visibility for login options
  };

  const handleButtonClick = (type) => {
    console.log(`${type} clicked`); // Handle button click for Doctor/Patient
  };

  return (
    <header className="header">
      {/* Logo */}
      <div className="logo">
        <img src="https://via.placeholder.com/150" alt="Doctro Logo" /> {/* Placeholder logo */}
      </div>

      {/* Navigation */}
      <nav className="nav-links">
        <ul>
          <li><a href="#services">Our Services</a></li>
          <li><a href="#about">About Us</a></li>
        </ul>
      </nav>

      {/* Login Button with Dropdown */}
      <div className="auth-buttons">
        <button className="btn" onClick={toggleLoginOptions}>
          Login
        </button>

        {/* Dropdown for Doctor/Patient */}
        {isLoginClicked && (
          <div className="dropdown">
            <button onClick={() => handleButtonClick('Doctor')} className="dropdown-btn">Doctor</button>
            <button onClick={() => handleButtonClick('Patient')} className="dropdown-btn">Patient</button>
          </div>
        )}
      </div>
    </header>
  );
};

export default Header;
